/*
REQUIREMENTS_BEGIN
{
    "chart_type": "Circular Bar Chart",
    "chart_name": "circular_bar_chart_01",
    "required_fields": ["x", "y"],
    "required_fields_type": [["categorical"], ["numerical"]],
    "required_fields_range": [[3, 20], [0, 100]],
    "required_fields_icons": [],
    "required_other_icons": [],
    "required_fields_colors": [],
    "required_other_colors": ["primary", "secondary", "background"],
    "supported_effects": ["gradient", "opacity"],
    "min_height": 600,
    "min_width": 800,
    "has_title": 1,
    "background": "light",
    "icon_mark": "none",
    "icon_label": "none",
    "has_x_axis": "yes",
    "has_y_axis": "yes"
}
REQUIREMENTS_END
*/

function makeChart(containerSelector, data) {
    const jsonData = data;
    const chartData = jsonData.data.data;
    const variables = jsonData.variables;
    const typography = jsonData.typography;
    const colors = jsonData.colors || {};
    const dataColumns = jsonData.data.columns || [];
    const images = jsonData.images || {};
    
    const title = jsonData.titles.main_title;
    // 清空容器
    d3.select(containerSelector).html("");
    
    // 获取字段名
    const xField = dataColumns[0].name;
    const yField = dataColumns[1].name;
    
    // 获取值的单位
    let valueUnit = dataColumns[1].unit === "none" ? "" : dataColumns[1].unit;
    if (valueUnit.length > 6) {
        valueUnit = ''
    }
    
    // 设置尺寸和边距
    const width = variables.width;
    const height = variables.height;
    const margin = { top: 120, right: 30, bottom: 120, left: 60 };
    const chartWidth = width - margin.left - margin.right;
    const chartHeight = height - margin.top - margin.bottom;
    // 创建SVG
    const svg = d3.select(containerSelector)
        .append("svg")
        .attr("width", "100%")
        .attr("height", height)
        .attr("viewBox", `0 0 ${width} ${height}`)
        .attr("style", "max-width: 100%; height: auto;")
        .attr("xmlns", "http://www.w3.org/2000/svg")
        .attr("xmlns:xlink", "http://www.w3.org/1999/xlink");

    // 为SVG添加一个根组，使所有内容居中
    const g = svg.append("g")
        .attr("transform", `translate(${width / 2}, ${height / 2})`);
    // 定义渐变
    const defs = g.append("defs");

    
    // radialGradient.append("stop")
    //     .attr("offset", "0%")
    //     .attr("stop-color", "#ed2005");
        
    // radialGradient.append("stop")
    //     .attr("offset", "100%")
    //     .attr("stop-color", "#ffffff");
    // 箭头渐变
    const arrowGradient = defs.append("linearGradient")
        .attr("id", "arrowGradient")
        .attr("x1", "0%")
        .attr("y1", "0%")
        .attr("x2", "100%")
        .attr("y2", "100%");
        
    arrowGradient.append("stop")
        .attr("offset", "0%")
        .attr("stop-color", "#ed2005");
        
    arrowGradient.append("stop")
        .attr("offset", "100%")
        .attr("stop-color", "#ffffff");
    
    // 设置图表尺寸
    const innerRadius = 100;
    const outerRadius = 220;
    
    // 定义起始和结束角度（0°到300°，在左上角留出60°缺口）
    const startAngle = 0;                  // 0度
    const endAngle = (5 * Math.PI) / 3;    // 300度 (5π/3弧度)
    
    // 创建角度比例尺
    const indices = chartData.map((_, i) => i);
    console.log(chartData);
    console.log(indices);
    const angleScale = d3.scaleBand()
        .domain(indices)
        .range([startAngle, endAngle])
        .padding(0.05);
    
    // 创建半径比例尺
    const radiusScale = d3.scaleLinear()
        .domain([0, 100])
        .range([innerRadius+50, outerRadius]);
    // 添加数值格式化函数
   const formatValue = (value) => {
    if (value >= 1000000000) {
        return d3.format("~g")(value / 1000000000) + "B";
    } else if (value >= 1000000) {
        return d3.format("~g")(value / 1000000) + "M";
    } else if (value >= 1000) {
        return d3.format("~g")(value / 1000) + "K";
    } else {
        return d3.format("~g")(value);
    }
}
    // 添加条形
    chartData.forEach((d, i) => {
        const startAngleBar = angleScale(i);
        const endAngleBar = startAngleBar + angleScale.bandwidth();
        const outerRadiusBar = radiusScale(d[yField]);
        console.log(d);

        console.log(startAngleBar);
        console.log(endAngleBar);
        console.log(outerRadiusBar);
        console.log(innerRadius);
        console.log(outerRadius);

        // 为每个条形创建独立的渐变
        const gradientId = `gradient-${i}`;
        const gradient = defs.append("radialGradient")
            .attr("id", gradientId)
            .attr("gradientUnits", "userSpaceOnUse")
            .attr("cx", "0")
            .attr("cy", "0")
            .attr("r", outerRadiusBar)
            .attr("fx", "0")
            .attr("fy", "0");

        gradient.append("stop")
            .attr("offset", `${(innerRadius/outerRadiusBar)*100}%`)
            .attr("stop-color", "#f8610a");

        gradient.append("stop")
            .attr("offset", "100%")
            .attr("stop-color", "#d5481f");

        // 创建弧形路径
        const arcPath = d3.arc()
            .innerRadius(innerRadius)
            .outerRadius(outerRadiusBar)
            .startAngle(startAngleBar)
            .endAngle(endAngleBar)
            .padAngle(0.03)
            .padRadius(innerRadius)
            .cornerRadius(3)(); // 添加圆角效果使边框更平滑
        console.log(arcPath);

        // 为阴影效果创建滤镜
        const filterId = `drop-shadow-${i}`;
        const filter = defs.append("filter")
            .attr("id", filterId)
            .attr("x", "-50%")
            .attr("y", "-50%")
            .attr("width", "200%")
            .attr("height", "200%");
            
        filter.append("feGaussianBlur")
            .attr("in", "SourceAlpha")
            .attr("stdDeviation", 3);
            
        filter.append("feOffset")
            .attr("dx", 2)
            .attr("dy", 2);
            
        filter.append("feComponentTransfer")
            .append("feFuncA")
            .attr("type", "linear")
            .attr("slope", 0.3);
            
        filter.append("feMerge")
            .selectAll("feMergeNode")
            .data(["", "SourceGraphic"])  // 调整顺序,让阴影在底层
            .enter()
            .append("feMergeNode")
            .attr("in", d => d);
        
        // 添加条形
        g.append("path")
            .attr("d", arcPath)
            .attr("fill", `url(#${gradientId})`) // 使用独立的渐变
            .attr("stroke", "white")  // 白色边框
            .attr("stroke-width", "3") // 增加边框宽度使其更明显
            .style("opacity", 1.0) // 添加透明度增强渐变效果
            .style("filter", `url(#${filterId})`); // 添加阴影效果
        
        // 添加百分比标签
        const labelAngle = startAngleBar + (endAngleBar - startAngleBar) / 2;
        const labelRadius = (outerRadiusBar + innerRadius) / 2;
        const labelX = Math.sin(labelAngle) * labelRadius;
        const labelY = -Math.cos(labelAngle) * labelRadius;
        const formattedValue = `${formatValue(d[yField])}${valueUnit}`;
        g.append("text")
            .attr("x", labelX)
            .attr("y", labelY)
            .attr("text-anchor", "middle")
            .attr("dominant-baseline", "middle")
            .attr("fill", "white")
            .attr("font-size", "18px")
            .attr("font-weight", "bold")
            .attr("font-family", "Arial, sans-serif")
            .text(formattedValue);

        // 添加xField标签
        const xLabelAngle = startAngleBar + (endAngleBar - startAngleBar) / 2;
        const xLabelRadius = outerRadiusBar + 45; // 在扇形外部45px处 (原来是30px，增加了15px)
        const xLabelX = Math.sin(xLabelAngle) * xLabelRadius;
        const xLabelY = -Math.cos(xLabelAngle) * xLabelRadius;

        g.append("text")
            .attr("x", xLabelX)
            .attr("y", xLabelY)
            .attr("text-anchor", "middle")
            .attr("dominant-baseline", "middle")
            .attr("fill", "#c75526")
            .attr("font-size", "16px")
            .attr("font-family", "Arial, sans-serif")
            // 调整字体粗细
            .attr("font-weight", "bold")
            .text(d[xField]);
        });
    // 带有缺口的内圈 - 使用弧形路径
    const innerCircleArc = d3.arc()
        .innerRadius(innerRadius - 1)
        .outerRadius(innerRadius)
        .startAngle(startAngle)
        .endAngle(endAngle);
    
    g.append("path")
        .attr("d", innerCircleArc)
        .attr("fill", "none")
        .attr("stroke", "#000")
        .attr("stroke-width", 1.5);
    
    // 添加图像
    const imageGroup = g.append("g")
        .attr("transform", `translate(${-width/2 + 50}, ${-height/2 + 50})`);
        
    imageGroup.append("image")
    .attr("xlink:href", "data:image/png;base64,")

        .attr("width", 300)
        .attr("height", 300)
        .attr("x", -30)
        .attr("y",-100);
    
    // 添加标题文本，每行使用渐变数组中的对应颜色
    const titleLines = title.split('\n').map(line => {
        if(line.length > 15) {
            return line.match(/.{1,15}/g) || [line];
        }
        return line;
    }).flat() || [];
    console.log(titleLines);
    // 计算标题总高度
    const totalHeight = titleLines.length * 25;
    const startY = 0;
    
    titleLines.forEach((line, i) => {
        g.append("text")
            .attr("x", 0)
            .attr("y", startY + i * 25)
            .attr("text-anchor", "middle")
            .attr("font-size", "22px") 
            .attr("font-weight", "bold")
            .attr("font-family", "Arial, sans-serif")
            .attr("fill", "url(#titleGradient)")
            .text(line);
    });
    // 定义标题渐变
    const titleGradient = defs.append("linearGradient")
        .attr("id", "titleGradient")
        .attr("x1", "100%")
        .attr("y1", "0%")
        .attr("x2", "0%")
        .attr("y2", "0%");
    
    // 添加渐变色
    const titleColors = [
        { offset: "0%", color: "#ff0000" },
        { offset: "100%", color: "#ffcc66" }
    ];
    
    titleColors.forEach(colorStop => {
        titleGradient.append("stop")
            .attr("offset", colorStop.offset)
            .attr("stop-color", colorStop.color);
    });
    
    return svg.node();
}